import React from 'react'


const Nav = () => {
    const navItems:Array<string> = ['Plan','Table']
    return(
    <>
        <img src="" alt=""/>
        <nav>
            <ul>
                {navItems.map((item) => <li>{item}</li>)}
            </ul>
        </nav>
        
    </>
    )
}

export default Nav
